function CreateFlow() {
    console.log("ddd")
    var modal = document.getElementById("CreateFlowModal");
    var close_CreateFlowModal = document.getElementsByClassName("close_CreateFlowModal_btn")[0];
    var open_CreateFlowModal_btn = document.getElementById("open_CreateFlowModal_btn");

    open_CreateFlowModal_btn.onClick = function() {
        modal.style.display = "block";
      }
    close_CreateFlowModal.onClick = function() {
        modal.style.display = "none";
    }

    window.onClick = function(event) {
    if (event.target == modal) {
        modal.style.display = "none";
    }
    }

  return (
    <div id="CreateFlowModal" class="CreateFlowModal">

        <div class="modal-content">
            <div class="modal-header">
                <span class="close">&times;</span>
                <h2>Modal Header</h2>
            </div>
            <div class="modal-body">
            <p>Some text in the Modal Body</p>
            <p>Some other text...</p>
            </div>
            <div class="modal-footer">
            <h3>Modal Footer</h3>
            </div>
        </div>

    </div>
  )
}

export default CreateFlow
